MongoDB: make $lookup put its output in objects inside an array<h2>Problem</h2>
<p>Say I have this document in a <code>project-storage</code> collection:</p>
<pre><code>{
  name: 'storage',
  containers: [
    { name: 'container1', items: ['item1', 'item2'] },
    { name: 'container2', items: ['item2', 'item3'] },
  ],
}
</code></pre>
<p>And these in a <code>project-items</code> collection:</p>
<pre><code>{ name: 'item1', value: 1 },
{ name: 'item2', value: 1 },
{ name: 'item3', value: 1 },
</code></pre>
<p>I want to write a query that reads the <code>storage</code> document and inlines the items of each <code>container</code> inside the container, to have this:</p>
<pre><code>{
  name: 'storage',
  containers: [
    {
      name: 'container1',
      items: ['item1', 'item2'],
      _inlinedItems: [{ name: 'item1', value: 1 }, { name: 'item2', value: 1 }]
    },
    {
      name: 'container2',
      items: ['item2', 'item3'],
      _inlinedItems: [{ name: 'item2', value: 1 }, { name: 'item3', value: 1 }]
    },
  ],
}
</code></pre>
<hr />
<h2>Failed attempt</h2>
<p>Using an <code>aggregate</code> and the <code>$lookup</code> operator, I tried this:</p>
<pre><code>[
  { $match: { name: 'storage' } },
  {
    $lookup: {
      from: 'project-items',
      localField: 'containers.items',
      foreignField: 'name',
      as: 'containers._inlinedItems',
    },
  },
]
</code></pre>
<p>Which does not work, because 1) it erases the <code>container</code> field completely and 2) it mixes the items from the two containers:</p>
<pre><code>{
  name: 'storage',
  containers: {
    _inlinedItems: [{ name: 'item1', value: 1 }, { name: 'item2', value: 1 }, { name: 'item3', value: 1 }]
  }
}
</code></pre>
<p>Is there a way to do this for example by putting something special in the <code>as</code> field of the <code>$lookup</code> operator?</p>
<hr />
<h2>Unsatisfactory solution</h2>
<p>The best I could do is to <code>unwind</code> the <code>containers</code>, do the lookup and then <code>group</code> the documents back together:</p>
<pre><code>[
  { $match: { name: 'storage' } },
  { $unwind: '$containers' },
  {
    $lookup: {
      from: 'project-items',
      localField: 'containers.items',
      foreignField: 'name',
      as: 'containers._inlinedItems',
    },
  },
  {
    $group: {
      _id: '$_id' ,
      name: { $first: '$name' },
      containers: { $push: '$containers' },
    },
  },
]
</code></pre>
<p>Which works, but I have to list all the properties from the storage document which I want to keep (for example <code>name</code> here), which is very problematic in my case since I do not know the names of all the properties, but I do need to keep them.</p>
<hr />
<h2>Proper solution?</h2>
<p>Am I missing something obvious? Is there a way to specify to the <code>$lookup</code> operator that I want it to write inside the <code>container</code> element it read the items from?
Or is the <code>unwind</code> + <code>group</code> the only way to do this?</p>

