Mongo DB sort by date and group by tag<p>I have a Mongo DB collection similar to this:</p>
<pre><code>{
    &quot;_id&quot;: &quot;...&quot;,
    &quot;name&quot;: &quot;name 1&quot;,
    &quot;created&quot;: &quot;2020-07-21T08:11:18.414+00:00&quot;,
    &quot;tags&quot;: [&quot;red&quot;, &quot;green&quot;]
}
{
    &quot;_id&quot;: &quot;...&quot;,
    &quot;name&quot;: &quot;name 2&quot;,
    &quot;created&quot;: &quot;2020-07-20T08:11:18.414+00:00&quot;,
    &quot;tags&quot;: [&quot;red&quot;, &quot;blue&quot;]
}
{
    &quot;_id&quot;: &quot;...&quot;,
    &quot;name&quot;: &quot;name 3&quot;,
    &quot;created&quot;: &quot;2020-07-19T08:11:18.414+00:00&quot;,
    &quot;tags&quot;: [&quot;green&quot;, &quot;blue&quot;]
}
{
    &quot;_id&quot;: &quot;...&quot;,
    &quot;name&quot;: &quot;name 4&quot;,
    &quot;created&quot;: &quot;2020-07-18T08:11:18.414+00:00&quot;,
    &quot;tags&quot;: [&quot;white&quot;, &quot;blue&quot;]
}
{
    &quot;_id&quot;: &quot;...&quot;,
    &quot;name&quot;: &quot;name 5&quot;,
    &quot;created&quot;: &quot;2020-07-17T08:11:18.414+00:00&quot;,
    &quot;tags&quot;: [&quot;white&quot;, &quot;green&quot;]
}
</code></pre>
<p>I need to be able to specify a list of tags, and, for each tag in the list, I need to fetch the most recently created document. In the example above, if I specify <code>[&quot;red&quot;, &quot;green&quot;, &quot;blue&quot;]</code>, I should get a result similar to this:</p>
<pre><code>{
    &quot;red&quot;: {
        &quot;_id&quot;: &quot;...&quot;,
        &quot;name&quot;: &quot;name 1&quot;,
        &quot;created&quot;: &quot;2020-07-21T08:11:18.414+00:00&quot;,
        &quot;tags&quot;: [&quot;red&quot;, &quot;green&quot;]
    },
    &quot;green&quot;: {
        &quot;_id&quot;: &quot;...&quot;,
        &quot;name&quot;: &quot;name 1&quot;,
        &quot;created&quot;: &quot;2020-07-21T08:11:18.414+00:00&quot;,
        &quot;tags&quot;: [&quot;red&quot;, &quot;green&quot;]
    },
    &quot;blue&quot;: {
        &quot;_id&quot;: &quot;...&quot;,
        &quot;name&quot;: &quot;name 2&quot;,
        &quot;created&quot;: &quot;2020-07-20T08:11:18.414+00:00&quot;,
        &quot;tags&quot;: [&quot;red&quot;, &quot;blue&quot;]
    }
}
</code></pre>
<p>My questions are:</p>
<ol>
<li>What would be the best Mongo DB query to obtain the above result?</li>
<li>If there are any skilled Spring Data experts around, how would it be translated into a Spring Data query, probably using an <code>AggregationOperation</code>?</li>
</ol>
<p>I would be happy with a good answer to question 1, and I can look for an answer to question 2 separately.</p>

