How to multiple match in Mongo aggregation<p>I'm having a collection of <code>Submission</code> documents.
Every <code>Submission</code> has a <code>bookingId</code>, a status of the submission and an indicator if an event was sent when the status is <code>SUCCESS</code></p>
<p>I'm trying to create an aggregation which returns a list of unique bookingIds. This list should contain a bookingId if all the submissions for that bookingId have the status <code>SUCCESS</code></p>
<p>Below I'm having a collection of example <code>Submission</code> documents:</p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;5f7349ebc783305b9331a4b0&quot;),
    &quot;bookingId&quot; : &quot;NW111&quot;,
    &quot;status&quot; : &quot;SUCCESS&quot;,
    &quot;sent&quot; : false
},
{
    &quot;_id&quot; : ObjectId(&quot;5f7349ebc783305b9331a4b1&quot;),
    &quot;bookingId&quot; : &quot;NW111&quot;,
    &quot;status&quot; : &quot;SUCCESS&quot;,
    &quot;sent&quot; : false
},
{
    &quot;_id&quot; : ObjectId(&quot;5f7349ebc783305b9331a4b2&quot;),
    &quot;bookingId&quot; : &quot;NW115&quot;,
    &quot;status&quot; : &quot;READY&quot;,
    &quot;sent&quot; : false
},
{
    &quot;_id&quot; : ObjectId(&quot;5f7349ebc783305b9331a4b3&quot;),
    &quot;bookingId&quot; : &quot;NW115&quot;,
    &quot;status&quot; : &quot;PROCESSING&quot;,
    &quot;sent&quot; : false
},
{
    &quot;_id&quot; : ObjectId(&quot;5f7349ebc783305b9331a4b4&quot;),
    &quot;bookingId&quot; : &quot;NW115&quot;,
    &quot;status&quot; : &quot;ERROR&quot;,
    &quot;sent&quot; : false
}
</code></pre>
<p>The expected outcome from the example above should be</p>
<pre><code>{
    &quot;bookingIds&quot; : [&quot;NW111&quot;]
}
</code></pre>
<p>What I have so far is the following:</p>
<pre><code>db.submissions.aggregate(
    [ { $match : { sent : false } } ]
);
</code></pre>

