      &quot;name&quot;: &quot;dogfrey&quot;,
      &quot;field&quot;: &quot;cowboy&quot;
    },
    {
      &quot;name&quot;: &quot;catsville&quot;,
      &quot;field&quot;: &quot;spaceman&quot;
    }
]
</code></pre>
<p><strong>roles collection</strong></p>
<pre><code>[
