    {
      &quot;id&quot;: 2,
      &quot;userType&quot;: &quot;cowboy&quot;,
      &quot;spaceman&quot;: &quot;tenner&quot;,
      &quot;num&quot;: 1
    }
]
</code></pre>
<p><strong>MongoDb query</strong></p>
<pre><code>db.users.aggregate([
  {
    &quot;$match&quot;: {
