  }
])
</code></pre>
<p><a href="https://mongoplayground.net/p/_lcQLOBlsay" rel="nofollow noreferrer">See here for the MongoPlayground example</a></p>
<p>The <a href="http://reactivemongo.org/releases/0.1x/documentation/advanced-topics/aggregation.html#lookup" rel="nofollow noreferrer">ReactiveMongo documentation</a> doesn't include any such examples suggesting that it may not be possible. Any help appreciated!</p>
