Using MongoDB Aggregator Framework to format data that match with chartjs scatter<p>I'm new using aggregators in MongoDB and I'm wondering if there is a way to format data at MongoDB level to prepare the results for plotting with <a href="https://www.chartjs.org/docs/latest/charts/scatter.html" rel="nofollow noreferrer">ChartJs scatter</a>.</p>
<p>So I have a time series dataset (I'm not sure that this is the best way to store time-series data, so any advice is welcome) that looks like this:</p>
<pre><code>{
    &quot;dataset_id&quot; : &quot;850919c9-30e4-46f1-b962-e6b16cd30c60&quot;,
    &quot;time_stamp&quot; : 1600624542,
    &quot;series&quot; : [ 
        {
            &quot;name&quot; : &quot;serie_0&quot;,
            &quot;value&quot; : 935.0
        }, 
        {
            &quot;name&quot; : &quot;serie_1&quot;,
            &quot;value&quot; : 780.0
        }, 
        ...
        {
            &quot;name&quot; : &quot;serie_n&quot;,
            &quot;value&quot; : &lt;value_n&gt;
        }, 
     ]
}
</code></pre>
<p>But for ChartJS I need a format like:</p>
<pre><code>[
    {
      label: '&lt;series_0_name&gt;',
      data: [
        {x: &lt;timestamp&gt;, y: &lt;value&gt;},
        ...
        {x: &lt;timestamp&gt;, y: &lt;value&gt;},
       ]
    },
    ...
    {
      label: '&lt;series_n_name&gt;',
      data: [
        {x: &lt;timestamp&gt;, y: &lt;value&gt;},
        ...
        {x: &lt;timestamp&gt;, y: &lt;value&gt;},
       ]
    },
]
</code></pre>
<p>To archive this at this moment I'm using this python code (I'm using PyMongo):</p>
<pre><code>def dataset_format(dataset_id, sample_size):
    match = {&quot;$match&quot;: {&quot;dataset_id&quot;: str(dataset_id)}}
    sample = {&quot;$sample&quot;: {&quot;size&quot;: sample_size}}
    unwind = {&quot;$unwind&quot;: {&quot;path&quot;: &quot;$series&quot;}}
    stages = [match, sample, unwind]

    pool = DB_POOL_COLLECTION.aggregate(stages)
    values = [
        (record[&quot;series&quot;][&quot;name&quot;], record[&quot;time_stamp&quot;], record[&quot;series&quot;][&quot;value&quot;])
        for record in pool
    ]

    data = [
        {&quot;label&quot;: d, &quot;data&quot;: [{&quot;x&quot;: v[1], &quot;y&quot;: v[2]} for v in values if v[0] == d]}
        for d in set(name[0] for name in values)
    ]

    return data
</code></pre>
<p>But thinking on a performance I think that moving this python formatting code to the MongoDb side I will increase the performance of my query. Also As I say before This project is starting from scratch so I'm open to suggestions about the Document style of my DB, thinking on I need a good performance on reading but I don't care about writing performance right now.</p>

